import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <Link to="/artworks">Artworks</Link>
      <Link to="/artists/profile">Artist Profile</Link>
      <Link to="/reviews">Reviews</Link>
    </nav>
  );
}

export default Navbar;
